import React from 'react';

import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function NavBar() {
  const lists = [
    { name: 'Home', path: '/' },
    { name: 'Todolist', path: '/todolist' },
  ];
  return (
    <Navbar expand="lg" className="theme-color" sticky='top'>
      <Container>
        <Row>
          <Col sm={8}>
            <Navbar.Brand href="#home">Blublu</Navbar.Brand>
          </Col>
          <Col sm={4}>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto justify-content-end">
            {lists.map(list => {
            return (
            <NavLink to={list.path}
            className={ ({isActive}) => isActive ? 'nav-link active' : 'nav-link' }
            >{list.name}</NavLink>
      )
    })}  

            <Nav.Link href="#home">ToDolist</Nav.Link>
            <Nav.Link href="#link">Weather</Nav.Link>
            <Nav.Link href="#link">Cocktails</Nav.Link>

          </Nav>
            </Navbar.Collapse>
          </Col>
        </Row>
      </Container>
    </Navbar>
  );
}

export default NavBar;
